import React from "react";
import { Link } from 'react-router-dom'

const ModeSelect = () => {
  return (
    <div className="mode-select">
          <p>ModeSelect</p>
          <Link to="/">
          <p>To Welcome</p>
        </Link>
    </div>
  );
};

export default ModeSelect;
